
        <!DOCTYPE html>
        <html>
        <head>
            <meta charset="utf-8">
            <title>多图层GeoJSON查看器</title>
            <style>
                html, body {
                    width: 100%;
                    height: 100%;
                    margin: 0;
                    padding: 0;
                    overflow: hidden;
                    background: white;
                }
                #container {
                    width: 100%;
                    height: 100%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                }
                svg {
                    max-width: 100%;
                    max-height: 100%;
                    width: auto;
                    height: auto;
                }
                .zoom-controls {
                    position: fixed;
                    top: 10px;
                    right: 10px;
                    display: flex;
                    flex-direction: column;
                    gap: 5px;
                    z-index: 1000;
                }
                .layer-controls {
                    position: fixed;
                    top: 10px;
                    left: 10px;
                    background: white;
                    padding: 10px;
                    border: 1px solid #ccc;
                    border-radius: 4px;
                    z-index: 1000;
                }
                .zoom-controls button {
                    width: 30px;
                    height: 30px;
                    font-size: 20px;
                    cursor: pointer;
                    background: white;
                    border: 1px solid #ccc;
                    border-radius: 4px;
                }
                .layer-controls label {
                    display: block;
                    padding: 3px 0;
                    color: #666;
                }
                .layer-controls input[type="checkbox"] {
                    margin-right: 8px;
                }
                path {
                    vector-effect: non-scaling-stroke;
                    stroke-width: 1px;
                }
                .dp3-path {
                    fill-opacity: 0.5;
                }
                text {
                    font-family: Arial;
                    fill: #964B00;
                    text-anchor: middle;
                    dominant-baseline: middle;
                    pointer-events: none;
                    vector-effect: non-scaling-stroke;
                }
                .text-container {
                    font-size: inherit;  # 使用动态计算的大小
                }
                .nav-point-container {
                    font-size: inherit;  # 使用动态计算的大小
                }
                .nav-label-container {
                    font-size: inherit;  # 使用动态计算的大小
                }
                .text-container text,
                .nav-point-container text,
                .nav-label-container text {
                    paint-order: stroke;
                    stroke: white;
                    stroke-width: 0.2px;
                    stroke-linecap: round;
                    stroke-linejoin: round;
                }
                .nav-point {
                    font-weight: bold;
                    fill: #FF4500;
                }
                .nav-marker {
                    stroke: #FF4500;
                    stroke-width: 2;
                    fill: none;
                }
                .nav-label {
                    fill: #FF4500;
                    font-weight: bold;
                    text-anchor: middle;
                    dominant-baseline: middle;
                }
                .layer-group {
                    margin-bottom: 10px;
                    border: 1px solid #ccc;
                    padding: 5px;
                    border-radius: 4px;
                }
                .layer-group-title {
                    font-weight: bold;
                    margin-bottom: 5px;
                    color: #333;
                    padding: 2px 0;
                }
                .marker {
                    fill-opacity: 0.8;
                    stroke: white;
                    stroke-width: 2px;
                }
                .marker-text {
                    fill: white;
                    font-size: 12px;
                    text-anchor: middle;
                    dominant-baseline: middle;
                    font-weight: bold;
                }
                .navigation-path {
                    stroke-width: 5px !important;
                    stroke-dasharray: 10,5;
                    animation: dash 20s linear infinite;
                    pointer-events: none;
                }
                @keyframes dash {
                    to {
                        stroke-dashoffset: 1000;
                    }
                }
            </style>
        </head>

                <div class="layer-group">
                    <div class="layer-group-title">基础图层</div>

                    <div class="layer-group-title">标识图层</div>

            <div class="zoom-controls">
                <button onclick="zoomIn()">+</button>
                <button onclick="zoomOut()">-</button>
                <button onclick="resetZoom()">R</button>
            </div>
            <script>
                const svg = document.getElementById('svg');
                const group = document.getElementById('zoomGroup');
                let currentScale = 1;
                let currentTranslateX = 0;
                let currentTranslateY = 0;
                let isDragging = false;
                let startX, startY;
                
                function zoomIn() {
                    currentScale *= 1.2;
                    updateTransform();
                }
                
                function zoomOut() {
                    currentScale /= 1.2;
                    updateTransform();
                }
                
                function resetZoom() {
                    currentScale = 1;
                    currentTranslateX = 0;
                    currentTranslateY = 0;
                    updateTransform();
                }
                
                function updateTransform() {
                    group.setAttribute('transform', 
                        'matrix(' + currentScale + ' 0 0 ' + currentScale + ' ' + currentTranslateX + ' ' + currentTranslateY + ')');
                }
                
                function toggleLayer(layerIndex) {
                    const layer = document.getElementById('layer_' + layerIndex);
                    layer.style.display = layer.style.display === 'none' ? 'block' : 'none';
                }
                
                svg.addEventListener('mousedown', (e) => {
                    isDragging = true;
                    startX = e.clientX - currentTranslateX;
                    startY = e.clientY - currentTranslateY;
                });
                
                document.addEventListener('mousemove', (e) => {
                    if (!isDragging) return;
                    currentTranslateX = e.clientX - startX;
                    currentTranslateY = e.clientY - startY;
                    updateTransform();
                });
                
                document.addEventListener('mouseup', () => {
                    isDragging = false;
                });
                
                svg.addEventListener('wheel', (e) => {
                    e.preventDefault();
                    const delta = e.deltaY;
                    const rect = svg.getBoundingClientRect();
                    const x = e.clientX - rect.left;
                    const y = e.clientY - rect.top;
                    
                    const mouseX = (x - currentTranslateX) / currentScale;
                    const mouseY = (y - currentTranslateY) / currentScale;
                    
                    if (delta > 0) {
                        currentScale /= 1.1;
                    } else {
                        currentScale *= 1.1;
                    }
                    
                    currentTranslateX = x - mouseX * currentScale;
                    currentTranslateY = y - mouseY * currentScale;
                    
                    updateTransform();
                });
            </script>
